(130, 32, '_form', '<div class=row><div class=col-md-6><div class=form_group><label for=\"\">First Name</label> [text* Contact_fname placeholder \"Enter your First Name\"]</div></div><div class=col-md-6><div class=form_group><label for=\"\">Last Name</label> [text* Contact_lname placeholder \"Enter your Last Name\"]</div></div><div class=col-md-6><div class=form_group><label for=\"\">Email Address</label> [email* contact_email placeholder \"Enter your Email Address\"]</div></div><div class=col-md-6><div class=form_group><label for=\"\">Company Name</label> [text* company_name placeholder \"Enter your Company Name\"]</div></div><div class=col-md-12><div class=form_group>[textarea message placeholder \"Enter your Message\"]</div></div></div><p>Ameritronics is committed to protecting and respecting your privacy, and we’ll only use your personal information to administer your account and to provide the products and services you requested from us. From time to time, we would like to contact you about our products and services, as well as other content that may be of interest to you. If you consent to us contacting you for this purpose, please tick below to say how you would like us to contact you<div class=checkbox_wapper><div class=wapper><div class=form_group>[checkbox* test-1 id:test-1 use_label_element \"I agree to receive other communications from Ameritronics.\"]</div><p>In order to provide you the content requested, we need to store and process your personal data. If you consent to us storing your personal data for this purpose, please tick the checkbox below.</div><div class=wapper><div class=form_group>[checkbox* test-2 id:test-2 use_label_element \"I agree to allow Weller to store and process my personal data.\"]</div><p>In order to provide you the content requested, we need to store and process your personal data. If you consent to us storing your personal data for this purpose, please tick the checkbox below.</div></div><div class=btn_wapper>[submit class:a_btn \"Submit\"]</div>'),
