(331, 46, '_about_title', 'field_65a7d420745d8'),
(332, 46, 'about_content', '<strong>AMERITRONICS®</strong> is a division of the Jacks’ Technologies &amp; Industries Corporation (JTI).\r\n\r\n<strong>AMERITRONICS®</strong> is a stocking distributor of the entire Zephyrtronics®, along with OK International, Metcal® soldering equipment, Pen-Vac® vacuum lifting and laboratory products, TopLine® products, Scienscope™ equipment and a wide selection of premium products, tools and supplies especially for the electronic bench-top.\r\n\r\nUnlike many distributors, we do not try to sell everything under the rainbow. Instead, we are focused only on the electronic bench-top and the engineers and technicians who work there.\r\n\r\nFurther, our Customer Service personnel are highly-trained and ready to help you with your bench-top applications.\r\n\r\nREACH US AT: <strong>Ameritronics®</strong>\r\n<ul>\r\n 	<li>Phone: 909-865-2595</li>\r\n 	<li>Fax: 562-470-6978</li>\r\n 	<li>email: sales@ameritronics.com</li>\r\n</ul>\r\n<strong>Ameritronics</strong> works very hard to have all of our catalog items in stock so that we an ship immediately. However, as with all businesses, we occasionally, albeit very rarely, have demand that outpaces our production capacity and occasionally must backorder. Most orders ship on the same day we receive them here at our factory and 98% of the balance of our orders ship within 3 days. If we can not deliver your item within that timeframe, we will make every effort to inform our customers of any foreseen delay. Because our equipment is highly specialized, <strong>Ameritronics</strong> reserves the right to refuse to sell our products to anyone at our discretion. Thank you!'),
