(491, 97, 'blog_post_content_box_0_heading', 'How to Choose the Right ABC PCB Holder For You :'),
(492, 97, '_blog_post_content_box_0_heading', 'field_65af5ad80d2a5'),
(493, 97, 'blog_post_content_box_0_content', 'First, all ABC\'s tracks accommodate PCB from 1/32\" (2.4mm) to 1/8\" (3.2mm) thick.  And our new ABC-XYZ accommodates PCB\'s clear up to 1/4\" (6mm) thick. We have an ABC tailor-made for you company\'s range of PC boards.'),
(494, 97, '_blog_post_content_box_0_content', 'field_65af5ae20d2a6'),
(495, 97, 'blog_post_content_box_1_heading', 'Our Classic ABC\'s :'),
(496, 97, '_blog_post_content_box_1_heading', 'field_65af5ad80d2a5'),
(497, 97, 'blog_post_content_box_1_content', 'Ideal for working with all sizes of PCB’s and also any Zephyrtronics AirBath Preheater.'),
(498, 97, '_blog_post_content_box_1_content', 'field_65af5ae20d2a6'),
(499, 97, 'blog_post_content_box_2_heading', 'ABC-1 :'),
(500, 97, '_blog_post_content_box_2_heading', 'field_65af5ad80d2a5'),
(501, 97, 'blog_post_content_box_2_content', 'The ABC-1 will hold within its tracks PCB\'s up to 10\" x 20\" (26cm x 52cm). Even larger boards rest on top of the open frame; you are not limited to 10\" x 20\" PCB\'s. The ABC-1 comes with 3 tracks, with the center track adjustable.'),
(502, 97, '_blog_post_content_box_2_content', 'field_65af5ae20d2a6'),
(503, 97, 'blog_post_content_box_3_heading', 'ABC-1Q :'),
(504, 97, '_blog_post_content_box_3_heading', 'field_65af5ad80d2a5'),
(505, 97, 'blog_post_content_box_3_content', 'The ABC-1-Q will hold within its tracks PCB\'s up to 10\" x 20\" (26cm x 52cm). Larger boards rest on top of the open frame, you are not limited to 10\" x 18\" PCB\'s. The ABC-1Q has 4 tracks, with 2 adjustable center tracks.'),
(506, 97, '_blog_post_content_box_3_content', 'field_65af5ae20d2a6'),
